import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import muscles from '../utils/muscles.json';
import MuscleGroup from '../components/MuscleGroup/MuscleGroup';
import './MusclesPage.css';

const MusclesPage = () => {
  const [muscles, setMuscles] = useState([]);

  useEffect(() => {
    const fetchMuscles = async () => {
      try {
        const response = await fetch('/api/muscles'); // Adjust the endpoint as necessary
        const data = await response.json();
        setMuscles(data);
      } catch (error) {
        console.error('Failed to fetch muscles:', error);
      }
    };

    fetchMuscles();
  }, []);

  return (
    <div>
      {muscles.map(muscle => (
        <div key={muscle.muscle_group_name}>
          <h3>{muscle.muscle_group_name}</h3>
          <img src={muscle.image_url} alt={muscle.muscle_group_name} />
        </div>
      ))}
    </div>
  );
};

export default MusclesPage;
